import React from 'react';

const HREmployees = () => (
  <div>
    <h2>Employees</h2>
    <ul>
      <li>Alice Admin (HR)</li>
      <li>Bob Employee (IT)</li>
    </ul>
  </div>
);

export default HREmployees;
